import Twitter from "../../images/twitter.png"
import Mail from "../../images/mail.png"
import Linkedin from "../../images/linkedin.png"
import Github from "../../images/github.png"
import "./contact.css"

function contact(){
    return(
        <div className="contact">
            <li className="iconContact"><img className="iconContactImg" src={Twitter} alt=""/></li>
            <li className="iconContact"><img className="iconContact" src={Github} alt=""/></li>
            <li className="iconContact"><img className="iconContact" src={Linkedin} alt=""/></li>
            <li className="iconContact"><img className="iconContact" src={Mail} alt=""/></li>
        </div>
    )
};
export default contact
